import "./style/Navbar.css";

function Navbar() {
  return (
    <nav className="Wrap-Navbar">
      <div className="Title">
        <h2>Rezzyn</h2>
      </div>
      <div className="List-Navbar">
        <ul className="List">
          <li>
            {" "}
            <a href="Home">Home</a>
          </li>
          <li>
            {" "}
            <a href="Coffee">About</a>
          </li>
        </ul>
      </div>
    </nav>
  );
}

export default Navbar;
